      out.write("                <div class=\"notice-full\">\r\n");
      out.write("                    <p class=\"notice-head\">出行指南及法规</p>\r\n");
      out.write("                    <ol class=\"notice-content\">\r\n");
      out.write("                        <li>为了您人身、财产的安全，请您避免在公开场合暴露贵重物品及大量现金。上街时需时刻看管好首饰、相机等随身物品。</li>\r\n");
      out.write("                        <li>游泳、漂流、潜水、滑雪、溜冰、戏雪等活动项目，均存在危险。参与前请根据自身条件，并充分参考当地相关部门及其它专业机构的相关公告和建议后量力而行。</li>\r\n");
      out.write("                        <li>乘坐国内航班的旅客，居民身份证过期不能继续使用。若有效期满的，可以凭临时居民身份证或公安机关出具的贴有本人近期免冠证件照、并加盖户籍专用章、注明有效期的《申领居民身份证回执》作为有效乘机身份证件替代使用。同时中华人民共和国护照可以作为有效乘机身份证件，办理国内航班购票、值机、安检手续；旅客乘坐国内航班，办理购票、值机、安检手续时，应当使用同一个有效乘机身份证件。中国大陆地区居民使用往来港澳通行证、往来台湾通行证乘坐国内航班的旅客，必须同时提供居民身份证或者民用机场公安机关签发的《乘坐民航飞机临时身份证明》才可办理登机手续。 特别提醒：凡是乘机的16周岁以下中国大陆地区居民（包含婴儿），务必出示包括出生证明、户口薄或户口所在地公安机关出具的身份证明（16周岁以下的人需在户籍所在地派出所出具身份证明，机场派出所无法开具临时证明）才可办理登机手续。 具体实施细则以机场相关部门指导意见为准。</li>\r\n");
      out.write("                        <li>为确保锂电池的安全运输，避免发生不安全事件，我们友情提醒您，民航局将对旅客携带锂电池乘机进行严格检查。详情请参考 民航局关于旅客行李中携带“锂电池、充电宝”乘机规定的公告。</li>\r\n");
      out.write("                    </ol>\r\n");
      out.write("                </div>\r\n");
      out.write("                <div class=\"notice-full\">\r\n");
      out.write("                    <p class=\"notice-head\">旅途中的注意事项</p>\r\n");
      out.write("                    <ol class=\"notice-content\">\r\n");
      out.write("                        <li>不要在街上长时间接打电话，确实需要时请进入路边的超市、商场、商铺等安全的地方，不要在靠车窗位置接打电话、玩弄手机、放置包裹等。</li>\r\n");
      out.write("                        <li>徒步行走时要遵守交通法规，在远离快车道的路基内侧或靠右行走，挎包方式以右肩和斜跨，包要放在身前。从以往发生的摩托车抢劫来看几乎都发生马路边上或自行车道中间。</li>\r\n");
      out.write("                        <li>避免在火车站或汽车站随意向人问路，如需问询请询问工作人员，避免被居心叵测的人误导和利用。</li>\r\n");
      out.write("                        <li>避免在火车站或汽车站购买东西，避免在火车站或汽车站打公用电话，车站大部分都是掺假货物而且价格昂贵，有时因询价不买而使自己不能脱身。</li>\r\n");
      out.write("                        <li>入住旅店、宾馆后要知晓所居住楼层，房间号码，熟知火灾逃生的消防通道，妥善保管自己的物品，反锁房门，不要轻信服务电话的优惠服务和上门服务。</li>\r\n");
      out.write("                        <li>上车后行走时要时刻保持警惕，防止包裹被小偷割包，落座后不要将装有钱物的衣服挂在车上的衣帽钩上，中途下车购买物品时要注意周边人，防止钱物被盗。</li>\r\n");
      out.write("                        <li>不要将手机挂在胸前，不给一些不法分子创造条件，走路要走行人道的内侧，不要靠马路太近，更不要走到机动车道上，这样容易招骑车歹徒袭击</li>\r\n");
